import "./App.css"
import { Modal } from "@chakra-ui/react";
import { useState } from "react"
import {FormLabel,Box,Input,HStack} from "@chakra-ui/react";
//import CadastroPaciente from "./CadastroP/cadasPaciente";
//import { useNavigate } from "react-router-dom";  

function App(){
    //const navigate = useNavigate()

    const [modalIsOpen,setIsOpen] = useState(false);
    
  const [name, setName] = useState('');
  const[cpf,setCpf]= useState('')
  const [dataN, setDataN] = useState('');
  const [naturalidade, setNaturalidade] = useState('');
  const [celular, setCelular] = useState('');
  const [telefone, setTelefone] = useState('');
  const [endereço,setEndereço] = useState('');
  const [cidade,setCidade] = useState('');
  const [sexo, setSexo] = useState('Masculino'); 

    function handleOpenModal(){
      setIsOpen(true)
    }

    function handleCloseModal(){
        setIsOpen(false)
      }
      function btnFunction() {
        const _id = cpf
    console.log(_id)
        axios.post('http://localhost:8000/formulario', {
    
          _id:cpf,
          name,dataN,naturalidade,celular,
          telefone,endereço,cidade,sexo
    
        })
          .then(response => {
            console.log(response);
          })
          .catch(error => {
            console.log(error);
          });
      }
    

    return(
        <div>
           <center><h2>Selecionar Pergunta</h2></center>
               <HStack spacing="4">
                  <Box w="100%" >
                    <FormLabel htmlFor="cpf">Buscar o Cpf do Paciente</FormLabel>
                    <Input className="wrap-input" 
                        id="cpf" 
                        type="cpf"
                        placeholder="Digite sua resposta..."
                    />
                  </Box>
                  <Box w="100%">
                    <FormLabel htmlFor="cpf">Cadastrar Paciente</FormLabel>
                    <div>
                    <button className="wrap-input"onClick={handleOpenModal}>
                        Cadastrar
                    </button>
                    <Modal 
    isOpen={modalIsOpen}
    onRequestClose={handleCloseModal}
    //style={custmStyles}
  >
    <div className="container">
      <div className="container-login">
        <div className="wrap-login">
          <form>
              <Center
                as="header"
                h={50}
                w={430}
                bg="#f29ef3"
                color="white"
                fontWeight="bold"
                ontSize="4xl"
                pb="8"
              >
              <h2>Cadastro de Paciente</h2>
              </Center><br></br>
            <FormControl display="flex" flexDir="column" gap="4">
                <HStack spacing="4">
                  <Box w="100%">
                    <FormLabel htmlFor="nome">Nome Completo</FormLabel>
                    <Input id="nome" type="nome" 
                    onChange={e => setName(e.target.value)}
                    />
                  </Box>
                  <Box w="100%">
                    <FormLabel htmlFor="cpf">Cpf</FormLabel>
                    <Input id="cpf" 
                    onChange={e => setCpf(e.target.value)}
                    />
                  </Box>
                </HStack>
                <HStack spacing="4">
                  <Box w="100%">
                    <FormLabel htmlFor="nasc">Data de Nascimento</FormLabel>
                    <Input id="nasc" type="date"
                    onChange={e => setDataN(e.target.value)}
                    />
                  </Box>
                  <Box w="100%">
                    <FormLabel htmlFor="natural">Naturalidade</FormLabel>
                    <Input id="natural" 
                    onChange={e => setNaturalidade(e.target.value)}
                    />
                  </Box>
                </HStack>
                <HStack spacing="4">
                  <Box w="100%">
                    <FormLabel htmlFor="cel">Celular</FormLabel>
                    <Input id="cel" type="number"
                    onChange={e => setCelular(e.target.value)}
                    />
                  </Box>
                  <Box w="100%">
                    <FormLabel htmlFor="Tefone">Telefone</FormLabel>
                    <Input id="Tefone" type="number"
                    onChange={e => setTelefone(e.target.value)}
                    />
                  </Box>
                </HStack>
                <HStack spacing="4">
                  <Box w="100%">
                    <FormLabel htmlFor="endereco">Endereço</FormLabel>
                    <Input id="endereco" 
                    onChange={e => setEndereço(e.target.value)}
                    />
                  </Box>
                  <Box w="100%">
                    <FormLabel htmlFor="cidade">Cidade</FormLabel>
                    <Input id="cidade"
                    onChange={e => setCidade(e.target.value)} 
                    />
                  </Box>
                </HStack>
            </FormControl>
              <div>
                <p>Selecione seu Sexo</p>
                <select value={sexo}  onChange={e => setSexo(e.target.value)} >
                  <option value="Feminino">Feminino</option>
                  <option value="Masculino">Masculino</option>
                  <option value="Outros">Outros</option>
                </select>
              </div>
            <br></br><br></br>
                <div className="container-login-form-btn">
                  <button type="submit" className="login-form-btn" onClick={btnFunction}>Entrar</button>
                  <button type="submit" className="login-form-btn" onClick={handleOpenModal}>Cadastrar</button>
                </div>
          </form>
        </div>
      </div>
    </div>
    
    </Modal>
                    </div>
                  </Box>
                </HStack>
        </div>
    )
}
export default App
